window.bookSummaryJSON = "<p><i>A high-stakes online game of dares turns deadly....</i> </p> <p>When Vee is picked to be a player in NERVE, an anonymous game of dares broadcast live online, she discovers that the game <i>knows</i> her. They tempt her with prizes taken from her ThisIsMe page and team her up with the perfect boy: sizzling-hot Ian. At first it's exhilarating - Vee and Ian's fans cheer them on to riskier dares with higher stakes. But the game takes a twisted turn when they're directed to a secret location with five other players for the grand-prize round. Suddenly they're playing all or nothing - with their lives on the line. Just how far will Vee go before she loses NERVE? </p> <p>With <i>Nerve</i>, debut author Jeanne Ryan delivers an intensely gripping suspense thriller perfect for fans of The Hunger Games.</p>"; 
